import './App.css';
import React from "react";

function makeData() {
  return JSON.parse(window.truthTable("((A|B)|(C|D))"));
}



function App() {
  const [data, setData] = React.useState([])
  React.useEffect(function() {
    window.brythonReady = function () {
      setData(makeData())
      console.log('something')
    }
  }, [])
  console.log(data)
  let numRows = 0
  if (Object.keys(data).length > 0) {
    numRows = data[Object.keys(data)[0]].length
  }
  const rows = []
  for (var i = 0; i < numRows; i++) {
    rows.push(Object.keys(data).map((key) => data[key][i]))
  }
  return (
    <div className="App">
      <table>
        <tr>
          {Object.keys(data).map((key) => <td>{key}</td>)}
        </tr>
        {
          rows.map((row) => <tr>{row.map((cell) => <td>{cell + ""}</td>)}</tr>)
        }
      </table>
    </div>
  );
}

export default App;
